  <script>
    function sum(arr) {
      return arr.reduce((total, current) => total + current, 0);
    }

    class Spiral {
      static Direction = {
        UP: 'UP',
        DOWN: 'DOWN',
        LEFT: 'LEFT',
        RIGHT: 'RIGHT',
      };

      static directionOrder = [
        Spiral.Direction.DOWN,
        Spiral.Direction.RIGHT,
        Spiral.Direction.UP,
        Spiral.Direction.LEFT,
      ];

      turn = 0;
      size = 1;
      position = [0, 0];
      direction = 0;

      constructor(size = 1) {
        this.size = size;
      }

      isInBoundaries(step) {
        const check = (x) => x >= this.turn && x < this.size - this.turn;

        const [x, y] = step;
        return check(x) && check(y);
      }

      shouldStartNextTurn(step) {
        return step[0] === this.turn && step[1] === this.turn;
      }

      changeDirection() {
        this.direction = (this.direction + 1) % Spiral.directionOrder.length;
      }

      move(position, direction) {
        const moveByDirection = {
          [Spiral.Direction.RIGHT]: ([x, y]) => [x + 1, y],
          [Spiral.Direction.DOWN]: ([x, y]) => [x, y + 1],
          [Spiral.Direction.LEFT]: ([x, y]) => [x - 1, y],
          [Spiral.Direction.UP]: ([x, y]) => [x, y - 1],
        };
        const directionName = Spiral.directionOrder[direction];
        return moveByDirection[directionName](position);
      }

      next() {
        return this.move(this.position, this.direction);
      }

      step() {
        let step = this.next();

        if (this.shouldStartNextTurn(step)) {
          this.turn++;
          return this.step();
        }

        if (!this.isInBoundaries(step)) {
          this.changeDirection();
          step = this.next();
        }

        this.position = step;
        return step;
      }
    }

    class Drawer {
      /** @type {HTMLCanvasElement} */
      canvas = document.createElement('canvas');
      context = this.canvas.getContext('2d');

      async copyToClipboard(format = 'image/png') {
        return new Promise((resolve, reject) => {
          this.canvas.toBlob((blob) => {
            navigator.clipboard.write([
              new ClipboardItem({[format]: blob})
            ]).then(resolve, reject);
          }, format);
        });
      }

      async imageFromBase64(base64) {
        const image = new Image();
        image.src = `data:image/jpg;base64,${base64}`;
        await image.decode();
        return image;
      }

      async decodeImages(images) {
        return Promise.all(
          images.map((image) => this.imageFromBase64(image)),
        );
      }

      buildMatrix(images) {
        const size = Math.ceil(Math.sqrt(images.length));
        const matrix = [...new Array(size)].map(() => new Array(size));
        const spiral = new Spiral(size);

        images.forEach((image, i) => {
          const [x, y] = i === 0 ? spiral.position : spiral.step();
          matrix[y][x] = image;
        });

        return matrix;
      }

      alignToGrid(matrix) {
        const rowHeights = new Array(matrix.length).fill(0);
        const columnWidths = new Array(matrix.length).fill(0);

        matrix.forEach((row, y) => {
          row.forEach((image, x) => {
            rowHeights[y] = Math.max(rowHeights[y], image.height);
            columnWidths[x] = Math.max(columnWidths[x], image.width);
          });
        });

        return [rowHeights, columnWidths];
      }

      resizeToFit(rowHeights, columnWidths) {
        this.canvas.width = sum(columnWidths);
        this.canvas.height = sum(rowHeights);
      }

      drawMatrix(matrix, rowHeights, columnWidths) {
        matrix.forEach((row, y) => {
          row.forEach((image, x) => {
            this.context.drawImage(
              image,
              sum(columnWidths.slice(0, x)),
              sum(rowHeights.slice(0, y)),
              image.width,
              image.height,
            );
          });
        });
      }

      async draw(items) {
        const encodedImages = items.toSorted((a, b) => a.position - b.position).map(({image}) => image);
        const images = await this.decodeImages(encodedImages);
        const matrix = this.buildMatrix(images);
        const [rowHeights, columnWidths] = this.alignToGrid(matrix);
        this.resizeToFit(rowHeights, columnWidths);
        this.drawMatrix(matrix, rowHeights, columnWidths);
      }
    }
